import { Avatar, Box, Button, Grid, TextField, Typography } from '@mui/material';
import { Link } from 'react-router-dom';
import {useForm} from 'react-hook-form';

import Container from '@mui/material/Container';

type FormTypes = {
  name: string;
  email: string;
  password: string;
};


export default function SignUp() {

  const {register, handleSubmit, formState: {errors}} = useForm<FormTypes>();

const onSubmit = () =>{};

  // const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
  //   event.preventDefault();
  //   const data = new FormData(event.currentTarget);
  //   console.log({
  //     email: data.get('email'),
  //     password: data.get('password'),
  //   });
  // };

  return (
      <Container component="main" maxWidth="xs">
        <Box sx={{marginTop: 8, marginBottom: 8,  display: 'flex', flexDirection: 'column', alignItems: 'center', }}>
          <Avatar sx={{ m: 1, bgcolor: 'primary.main' }}></Avatar>
          <Typography component="h1" variant="h5" sx={{ fontWeight: 'bold' }}> Sign up </Typography>
          <Box component="form" onSubmit={handleSubmit(onSubmit)} sx={{ mt: 3 }}>
            <Grid container spacing={2}>

              <Grid item xs={12}>
                <TextField
                  fullWidth
                  id="name"
                  label="Name"
                  name="lastName"
                  autoComplete="family-name"
                />
                {errors && <p>{errors.name.message}</p>}

              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  id="email"
                  label="Email Address"
                  name="email"
                  autoComplete="email"
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="new-password"
                />
              </Grid>
            </Grid>
            <Button type="submit" fullWidth variant="contained" sx={{ mt: 3, mb: 2 }} > Sign Up </Button>
            <Grid container justifyContent="flex-end">
              <Grid item>
                <Link to="/signin"> Already have an account? Sign in </Link>
              </Grid>
            </Grid>
          </Box>
        </Box>
      </Container>
  );
}
